const MainContent = () => {
  return (
    <main className="p-4">
      <h2 className="text-xl font-semibold">Welcome to My App!</h2>
      <p className="mt-2">
        This is a sample React application using TypeScript and Tailwind CSS.
      </p>
    </main>
  );
};

export default MainContent;
